import { useState, useEffect } from "react";
import "./App.css";
import Button from "./Button";

function App() {
  const [value, setValue] = useState(0);
  const counter = (prev) => {
    setValue(prev + 1);
  };
  useEffect(() => {
    console.log("load api");
  }, []);
  return (
    <div className="App">
      <h1>hello</h1>
      <p>{value}</p>
      <Button text={"버튼"} onClick={counter} />
    </div>
  );
}

export default App;
